INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (0, 1, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 0.0, 1, 24, "2020/04/30 12:00:00", 10040, 24001, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 1, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 1, 24, "2020/04/30 12:00:00", 10040, 24002, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (2, 1, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 1, 24, "2020/04/30 12:00:00", 10040, 24003, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (3, 2, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 0.0, 2, 24, "2020/04/30 12:00:00", 10040, 24004, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 1, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 1, 24, "2020/04/30 12:00:00", 10040, 24005, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (5, 2, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 2, 24, "2020/04/30 12:00:00", 10040, 24006, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (6, 2, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 0.0, 2, 24, "2020/04/30 12:00:00", 10040, 24007, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (7, 4, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 4, 24, "2020/04/30 12:00:00", 10040, 24008, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (8, 4, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 4, 24, "2020/04/30 12:00:00", 10040, 24009, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (9, 4, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 4, 24, "2020/04/30 12:00:00", 10040, 24010, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (10, 4, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 0.0, 4, 24, "2020/04/30 12:00:00", 10040, 24011, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (11, 4, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 4, 24, "2020/04/30 12:00:00", 10040, 24012, 102601, 0.0, "リン", 0.0);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (12, 4, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 1, 24, "2020/04/30 12:00:00", 10040, 24013, 102601, 0.0, "リン", 1.81);
